window.bookSummaryJSON = "<p><b>As a human domina, Camille's only purpose in life is to birth vampire children for the powerful Quiet King.</b></p> <p>Trapped within the castle walls under strict rules and constant surveillance by guards, Camille has spent the last two years witnessing the brutal slaughter of innocent babies and insurmountable atrocities against other women.</p> <p>Camille decides to take matters into her own hands and plans to escape with the help of a vampire Path Finder named Xander, who is known for aiding many humans out of slavery.</p> <p>As Camille and Xander embark on their adventure, she soon discovers that Xander holds secrets that could change their world forever.</p> <p>Together, Camille and Xander navigate a dangerous and thrilling journey filled with romance, mystery, and edge-of-your-seat action.</p>"; 
